import React from "react"

import {Button} from "../../components/index"

import {TiMediaPlay} from "../../assets/icons/icons"

import * as style from "./Login.module.scss"


export const Login = () => {

  const onShow = () => {

  }

  return (
    <div className={Login.page}>
      <div className={Login.card}>
        <h2>Welcome to vahidChat!</h2>
        <Button
          text="Continue"
          wrapperClass={`${style.button}`}
          icon={<TiMediaPlay/>}
          isIconShown={true}
        />
      </div>
    </div>
  )
}
